class UndoControl extends Control {
  /**
   * @param {Object} [opt_options] Control options.
   */
  stack = []
  constructor(opt_options) {
    const options = opt_options || {};

    const button = document.createElement('button');
    button.innerHTML = 'Pulisci';

    const element = document.createElement('div');
    element.className = 'ol-control ctrl-undo';
    element.appendChild(button);

    super({
      element: element,
      target: options.target,
    });

    button.addEventListener('click', this.handleUndo.bind(this), false);
  }

  handleUndo() {
    if (this.stack.length > 0) {
      console.log(this.stack)
      let feature = this.stack.pop()
      console.log(this.stack)
      feature.setStyle(new Style({
        stroke: new Stroke({
          color: 'blue',
          width: 1,
        }),
        fill: new Fill({
          color: 'rgba(0, 0, 0, 0.1)',
        })
      }))
    }
  }
}

class GetGridControl extends Control {
  /**
   * @param {Object} [opt_options] Control options.
   */
  x0 = 0
  y0 = 0
  xn = 0
  yn = 0
  disabled = true
  constructor(opt_options) {
    const options = opt_options || {};

    const button = document.createElement('button');
    button.innerHTML = 'Ottieni griglia';

    const element = document.createElement('div');
    element.className = 'ol-control ctrl-get-grid ctrl-get-grid-disabled';
    element.appendChild(button);
    super({
      element: element,
      target: options.target,
    });
    this.element = element
    button.addEventListener('click', this.handleGetGrid.bind(this), false);
  }

  handleGetGrid() {
    // send x0,y0,xn,yn to the API Service and wait for the response
  }

  enableControl() {
    this.disabled = false
    this.element.className = 'ol-control ctrl-get-grid';
  }

  disableControl() {
    this.disabled = true
    this.element.className = 'ol-control ctrl-get-grid ctrl-get-grid-disabled';
  }
}

// Calculation of resolutions that match zoom levels 1, 3, 5, 7, 9, 11, 13, 15.
const resolutions = [];
for (let i = 0; i <= 8; ++i) {
  resolutions.push(156543.03392804097 / Math.pow(2, i * 2));
}
// Calculation of tile urls for zoom levels 1, 3, 5, 7, 9, 11, 13, 15.
function tileUrlFunction(tileCoord) {
  return (
    'https://{a-d}.tiles.mapbox.com/v4/mapbox.mapbox-streets-v6/' +
    '{z}/{x}/{y}.vector.pbf?access_token=' +
    key
  )
    .replace('{z}', String(tileCoord[0] * 2 - 1))
    .replace('{x}', String(tileCoord[1]))
    .replace('{y}', String(tileCoord[2]))
    .replace(
      '{a-d}',
      'abcd'.substr(((tileCoord[1] << tileCoord[0]) + tileCoord[2]) % 4, 1)
    );
}

let code = "3035"
let name = "ETRS89-extended / LAEA Europe"
let proj4def = "+proj=laea +lat_0=52 +lon_0=10 +x_0=4321000 +y_0=3210000 +ellps=GRS80 +towgs84=0,0,0,0,0,0,0 +units=m +no_defs"
let bbox = [84.17, -35.58, 24.6, 44.83]
const newProjCode = 'EPSG:' + code;

proj4.defs(newProjCode, proj4def);
register(proj4);
const newProj = getProjection(newProjCode);
const fromLonLat = getTransform('EPSG:4326', newProj);

let worldExtent = [bbox[1], bbox[2], bbox[3], bbox[0]];
newProj.setWorldExtent(worldExtent);

// approximate calculation of projection extent,
// checking if the world extent crosses the dateline
if (bbox[1] > bbox[3]) {
  worldExtent = [bbox[1], bbox[2], bbox[3] + 360, bbox[0]];
}
const extent = applyTransform(worldExtent, fromLonLat, undefined, 8);
newProj.setExtent(extent);

let undo = new UndoControl()
let getGrid = new GetGridControl()

const map = new Map({
  controls: defaultControls().extend([undo, getGrid]),
  layers: [
    new TileLayer({
      source:new OSM()
    }),
    vectorLayer
  ],
  target: 'map',
  view: new View({
    projection: newProj,
    center: [4559505, 2130995],
    extent: extent,
    zoom: 16,
  }),
});

